import React, { useState } from 'react';

function Parent() {
  const [items, setArr] = useState([]);

  const addItem = () => {
    setArr([
      ...items,
      {
        name: 'Tanveer',
        age: Math.floor(Math.random() * 10) + 1,
      },
    ]);
  };

  return (
    <div>
      <button onClick={addItem}>+</button>
      <ul>
        {items.map((item) => (
          <li key={item.age}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default Parent;
